import React from 'react';
import Button from './Button';
import '../style/projects.css';
import video2 from '../rs/Démo_Chocolatine.mov'
import video1 from '../rs/VideoDemoRPG.mp4';

const VideoSquare = ({ title, video, text }) => {
  return (
    <div className='ProjectSquare'>
      <h1>{ title }</h1>
      <p>{text}</p>
      <video src={video} width="500" height="250" controls>
      </video>
    </div>
  );
}

const ImageSquare = ({ title, image, text }) => {
  return (
    <div className='ProjectSquare'>
      <h1>{ title }</h1>
      <p>{text}</p>
      <img src={image} alt="SquareImage"/>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <main className='HomeBody'>
        <Button text="PROJETS" />
      </main>
      <div className='VideoProjects1'>
        <VideoSquare title="Chocolatine" text="L'un des deux projets du module DevOps" video={video2} />
        <VideoSquare title="MY_RPG" text="Le projet graphique de fin d'année" video={video1} />
      </div>
      <div className='ImageProjects1'>
        <ImageSquare title="TEST" text="CECI EST UN TEST" image={null} />
        <ImageSquare title="TEST" text="CECI EST UN TEST" image={null} />
      </div>
    </div>
  );
}

export default App;
